#!/bin/sh
# TopGen Container start/stop/status (glsomlo@cert.org, Oct. 2015)
status() { pidof named && pidof nginx && pidof master && pidof dovecot && pidof tor }
start() { for i in $(cat /var/lib/topgen/etc/hosts.* | awk '{print $1}' | sort -u); do /usr/sbin/ip addr add $i scope global dev lo done [ -s /var/lib/topgen/etc/named.conf ] && \ /usr/sbin/named -u named -c /var/lib/topgen/etc/named.conf [ -s /var/lib/topgen/etc/nginx.conf ] && \ /usr/sbin/nginx [ -s /var/lib/topgen/etc/postfix/main.cf ] && \ /usr/sbin/postfix -c /var/lib/topgen/etc/postfix start [ -s /var/lib/topgen/etc/postfix/dovecot.conf ] && \ /usr/sbin/dovecot -c /var/lib/topgen/etc/postfix/dovecot.conf [ -s /var/lib/topgen/etc/tor/torrc ] && { cp -r /var/lib/topgen/etc/tor/keys /var/lib/tor/ TDA_ADDR=$(getent ahostsv4 $(hostname) | head -1 | cut -d' ' -f1) /bin/tor -f /var/lib/topgen/etc/tor/torrc \ --orport 5000 --dirport 7000 --nickname $(hostname -s) \ --address $TDA_ADDR --outboundbindaddress $TDA_ADDR \ --authoritativedirectory 1 --v3authoritativedirectory 1 \ --v3authvotinginterval 10 --v3authvotedelay 2 --v3authdistdelay 2 } }
stop() { /bin/killall tor pidof dovecot && \ /usr/sbin/dovecot -c /var/lib/topgen/etc/postfix/dovecot.conf stop pidof master && \ /usr/sbin/postfix -c /var/lib/topgen/etc/postfix stop pidof nginx && \ /usr/sbin/nginx -s quit pidof named && \ /usr/sbin/rndc stop /usr/sbin/ip addr flush scope global dev lo }
restart() { stop start }
case "$1" in start|stop|restart|status) $1 ;; *) echo "Usage: $0 {start|stop|restart|status}" exit 2 ;; esac

#!/bin/sh
# tor config file and consensus URL ("DA:DP/path"): CFG_FILE='/var/lib/topgen/etc/tor/torrc' CONS_URL='topgen.info:7000/tor/status-vote/current/consensus'
# only if config file exists: if [ -s $CFG_FILE ]; then # wait for DA to become available... while (($(wget $CONS_URL -O- 2>/dev/null | grep '^r ' | wc -l)<1)); do sleep 5 done # ... before starting up the onion router daemon: TDA_ADDR=$(getent ahostsv4 $(hostname) | head -1 | cut -d' ' -f1) /bin/tor -f $CFG_FILE --orport 5000 --ExitRelay 1 \ --address $TDA_ADDR --nickname $(hostname -s) fi

